"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?15/50/16169/abstract/1\">",
"      Lien TH, Chang MH, Wu JF, et al. Effects of the infant stool color card screening program on 5-year outcome of biliary atresia in Taiwan. Hepatology 2011; 53:202.",
"     </a>",
"    </li>",
