var title_f15_50_16172="Causes of renal failure in the patient with cancer";
var content_f15_50_16172=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F80682&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F80682&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of renal failure in the patient with cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Prerenal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypovolemia (vomiting, diarrhea, hypercalcemia)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatorenal syndrome (veno-occlusive disease after hematopoietic cell transplantation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Drugs (NSAIDs, interleukin-2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Intrarenal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Glomerular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Amyloidosis (multiple myeloma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Light chain deposition disease (multiple myeloma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Membranous nephropathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Collapsing glomerulopathy (bisphosphonates)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Tubulointerstitial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Acute tubular necrosis (toxic/ischemic)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Cast nephropathy (multiple myeloma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Light chain deposition disease (multiple myeloma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lymphomatous infiltration of the kidneys",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Drugs (cisplatin, ifosfamide)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lysozyme (released from acute monocytic or myelomonocytic leukemia cells)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Vascular",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        HUS/TTP (gemcitabine, other chemotherapy drugs; after hematopoietic cell transplantation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Postrenal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intratubular obstruction (acute uric acid nephropathy, methotrexate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Extrarenal obstruction (gastrointestinal, urological or gynecological malignancy)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Humphreys BD, Soiffer RJ, Magee CC. Renal failure associated with cancer and its treatment: an update. J Am Soc Nephrol 2005; 16:151.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
