"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F80457&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 496px\">",
"   <div class=\"ttl\">",
"    Sleep stages as a percentage of total sleep time in COPD",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 476px; height: 288px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sleep stages as a percentage of total sleep time in a) normal subjects, b)&nbsp;chronic obstructive pulmonary disease (COPD)&nbsp;patients not receiving supplemental oxygen (COPD Air), and c) COPD patients receiving supplemental oxygen (COPD O",
"    <sub>",
"     2",
"    </sub>",
"    ). The COPD patients have less rapid-eye-movement (REM) sleep and less slow-wave sleep (SWS), and this difference is not significantly increased by supplemental oxygen.",
"    <div class=\"footnotes\">",
"     W: awake; 1: sleep stage 1; 2: sleep stage 2; SWS: slow-wave sleep; REM: rapid eye-movement.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Fleetham J, West P, Mezon B, Conway W, Roth T, Kryger M. Sleep, arousals, and oxygen desaturation in chronic obstructive pulmonary disease: the effect of oxygen therapy. Am Rev Respir Dis 1982; 126:429. Copyright &copy;1982 American Thoracic Society.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
